import React from "react";
import PropTypes from 'prop-types';

const TaskCompleteButton = ({completeButtonImg, index}) => {
  return (
    <img src={completeButtonImg} value={index} alt=''></img>
  );
};

TaskCompleteButton.defaultProps = {
  completeButtonImg: '../../images/icons8-checked-64.png',
  index: -1
};

TaskCompleteButton.propTypes = {
  completeButtonImg: PropTypes.string.isRequired,
  index: PropTypes.number.isRequired
}

export default TaskCompleteButton;
